import React from 'react';
import './Header.scss';

interface IHeaderProps {}

const Header : React.FC<IHeaderProps> = props => {
    return (
        <section className={`header`}>

            <div className={`header-hero-image`}></div>
        </section>
    );
}

export default Header;
